import React from 'react';
import Toolbar from './Toolbar';
import logo from './logo.svg';
import './App.css';
import { createElement } from 'react';

function Home() {

    const QUESTION_URL = "file:///C:/Users/Zacha/Desktop/opencode/frontend/question.html"
    var i

    function getAllQuestionNames() {
        let listOfQuestions = []

        fetch("http://localhost:8080/api/v1/question")
          .then(response => response.json().then(function(json) {
            for(i = 0; i < json.length; i++) {
              let li = createElement('li', {id: i}, "<a href=" + QUESTION_URL + "?name=" + json[i].name + ">" + json[i].name + "</a>")
              listOfQuestions.push(li)
            }
          }))
          return createElement('ul', {className: 'list'}, listOfQuestions)
    }

    return(
        <>
            <Toolbar />

            <div>
                {getAllQuestionNames()}
            </div>

            <div className="App">
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
                    <p>
                    Edit <code>src/App.js</code> and save to reload.
                    </p>
                    <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                    >
                    Learn React
                    </a>
                </header>
            </div>
        </>
    )
}

export default Home;
